import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <nav classname="navbar">
      <h1>
        <Link to="/">Anything</Link>
      </h1>
      <div className="links">
        <Link to="/"></Link>
        <Link to="/create">Create Blog</Link>
      </div>
    </nav>
  );
};
export default NavBar;
